import React from "react"
import './Home.css';
function Home(){
    return (
        <div className="home">
        <div className="home_container">
            <img src="https://images-eu.ssl-images-amazon.com/images/G/02/digital/video/merch2016/Hero/Covid19" alt="img" />
        </div>
        </div>
    )
}
export default Home
